import st from "./Login.module.scss";

const Login = () => {
  return (
    <section className={st.login}>
      <div>Login</div>
      <form>
        <label>
          ID
          <input placeholder="ID" />
        </label>
        <label>
          PW
          <input placeholder="PW" />
        </label>
      </form>
    </section>
  );
};

export default Login;
